import React, { Component } from "react";
import { Button } from "react-bootstrap";
import "./Home.css";

export default class Home extends Component {
  render() {
    return (
      <div className="Home">
        <div className="lander">
          <h1>ARE YOU READY TO BEGIN?</h1>
          <Button bsStyle="primary" bsSize="large">
            Large button
          </Button>
        </div>
      </div>
    );
  }
}
